import {Link} from 'react-router-dom';

const Navbar = () => {
    return(
        <div>
            <nav className='navbar'>
                <div className='logo'><img src="../assets/pokemon_logo.png" alt="logo" width="50" height="60"></img></div>
                <Link to="/"> <div style={{height:'20px', width:'50px', float:'left', backgroundColor:'white',marginTop:'50px'}}>Home</div></Link>
                <Link to="/compare">  <div style={{height:'20px', width:'50px', float:'left', backgroundColor:'white',marginLeft:'20px',marginTop:'10px'}}>Compare</div></Link>
            </nav>   
        </div>
    );
};

export default Navbar;
